import { Route, Switch } from "react-router";
import "./App.css";
import Movies from "./components/Movies";
import Navbar from "./components/Navbar";

function App() {
  return (
    <main className="container">
      <Switch>
        <Route path='/mov'/>
      </Switch>
      <Navbar />
      <Movies />
    </main>
  );
}

export default App;
